import React from 'react';
import './About.css';

export default function About() {
  return (
    <div className='about'>
      <div className="about-container" data-bg-about="ABOUT">
        <div className="heading">Get to Know Me</div>

        <div className="info">
          <div className="info-container">
            Hi, my name is Anqi.
            I enjoy creating things that live on the internet. My interest in web development started back in winter break during my sophomore year when I decided to try out building an online portfolio —— and now, I am immersed in the wonderful sea of web coding, unable to extricate myself! I am planning to study courses related to front-end development and UI/UX.

          </div>

          <div className="photo">


          </div>


        </div>

      </div>
      
      
    </div>
  )
}
